import './App.css';
import Logout from './components/Logout';
import Nav from './components/Nav';
import Home from './components/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import {Typography, Grid, Container} from '@material-ui/core';

function App() {


  return(
    <Router>
      <Container maxWidth = "xl">
        <Grid container spacing = {3}>
            <Switch>
            <Route path = "/home" exact>
              <Nav id = "1"/>
              <Home />
            </Route>
            <Route exact path="/">
              <Redirect to="/home" /> 
            </Route>
            <Route path = "/profile">
              <Nav id = "2"/>
              <Profile />
            </Route>
            <Route path = "/about">
              <Nav id = "3"/>
              <About />
            </Route>
            <Route path = "/logout">
              <Logout/>
            </Route>
          </Switch>
          </Grid>
      </Container>
    </Router>
  );
}

export default App;

function About(){
  return <Grid container item xs = {9}><h1>About</h1></Grid>;
}

function Profile(){
  return <Grid container item xs = {9}><h1>Profile</h1></Grid>;
}
